import { useEffect, useState } from "react";
import "../Header/Header.css";
import Image1 from "../Header/images.png";
import ReactDOM from "react-dom";
import 'bootstrap/dist/css/bootstrap.css';
const name = "Flash";
const currDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();

const Header = () => {
  
  const [currentTime,SetcurrentTime]=useState(currTime.seconds);

  useEffect(()=>{
    SetcurrentTime(currTime.seconds)
  },[currTime.seconds])

  return (
    <div>
      <header className="header">
        
      </header> 

      <nav className="navbar navbar-expand-lg bg-primary navbar-dark py-3">
      <div className="container">
        <img className="img1" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRFUyjXzzx6DUuFOdld6t7ToxT__gUxxkjfOPv-nNuvayL4L3jmQuQ2r6EIskGYFZ715UY&usqp=CAU" alt="" /> 
        <a href="#" className="navbar-brand ">NPM TEAM</a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navmenu"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navmenu">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <p className="p1">{currDate} </p>
            </li>
          </ul>
        </div>


       
        {/* <p className="p1">{currTime}</p> */}
  
      </div>
    </nav>
     
    </div>
  );
};

export default Header;
